Just as function types generalise to dependent function types, pair types generalise to dependent pair types where the type of the second component is allowed to depend on the value in the first component. If A : Type and B : A → Type, then the dependent pair type is written Σ[ x ∈ A ] B x. These types are often called "sum types" hence the symbol Σ. Dependent pair types are used just like the non-dependent pair types: we use the comma , to construct a pair and projections fst and snd to deconstruct a pair. Only the types of these things have changed: my-pairΣ : {A : Type} → {B : A → Type} → (x : A) → B x → Σ[ x ∈ A ] B x
my-pairΣ a b = (a , b) my-fstΣ : {A : Type} → {B : A → Type} → Σ[ x ∈ A ] B x → A
my-fstΣ p = p .fst my-sndΣ : {A : Type} → {B : A → Type} → (p : Σ[ x ∈ A ] B x) → B (p .fst)
my-sndΣ p = p .snd The type of snd is a little complicated! When we form p .snd, its type depends on what is in the first component p .fst. That is, the type of p .snd is the value of the input type family B : A → Type when evaluated at p .fst. To express that in the type of my-sndΣ, we have to use a dependent function so that B (p .fst) can refer to the pair p. Try writing the types for a dependently-typed version of ×-mapⁱ. All you need to do is replace the × from the previous definition with an appropriate Σ-type. -- Exercise:
-- Σ-mapⁱ : {A : Type} {B : A → Type} {A' : Type} {B' : A' → Type}
-- → (f : A → A')
-- → (g : (a : A) → B a → B' (f a))
-- → {!!} → {!!} Σ-mapⁱ f g (a , b) = (f a , g a b) Notice that the type of g has changed from the type it had back in ×-mapⁱ. Rather than giving a single function B → B', we have to now give a function B a → B' (f a) for each possible a : A. ×-curry and ×-uncurry can be generalised to work with dependent pairs and functions. Σ-curryⁱ : {A : Type} → {B : A → Type} → {C : (x : A) → B x → Type} → ((p : Σ[ x ∈ A ] B x) → C (p .fst) (p .snd)) → (x : A) → (y : B x) → C x y
Σ-curryⁱ f x y = f (x , y) Σ-uncurryⁱ : {A : Type} → {B : A → Type} → {C : (x : A) → B x → Type} → ((x : A) → (y : B x) → C x y) → (p : Σ[ x ∈ A ] B x) → C (p .fst) (p .snd)
Σ-uncurryⁱ f p = f (p .fst) (p .snd) Like ×, we can chain Σ together however we like. The dependent types do make this a little more complicated though! Suppose we start with dependent types A : Type, B : A → Type, and C : (x : A) → B x → Type. Say we already have an element a : A in mind. Then, we can use a Σ-type to form the type Σ[ b ∈ B a ] C a b. This is a type family that works for any a : A, so we can use another Σ-type to give Σ[ a ∈ A ] (Σ[ b ∈ B a ] C a b) in total. This is the type that corresponds to the non-dependent triple A × (B × C). We can also start pairing on the other side, so using the first two types to form Σ[ a ∈ A ] B a. To combine this with C using another Σ, we now need a type family Σ[ a ∈ A ] B a → Type, which doesn't match the type of C. But it's easy to fix that mismatch by projecting the components where we need them: Σ[ p ∈ (Σ[ a ∈ A ] B a) ] C (p .fst) (p .snd) This corresponds to the non-dependent triple (A × B) × C. As with non-dependent pairs, these two types are interconvertible. -- Exercise:
-- Σ-assoc-toⁱ : {A : Type} → {B : A → Type} → {C : (x : A) → B x → Type}
-- → {!!}
-- → {!!} Σ-assoc-toⁱ (a , (b , c)) = (a , b) , c -- Exercise:
-- Σ-assoc-froⁱ : {A : Type} → {B : A → Type} → {C : (x : A) → B x → Type}
-- → {!!}
-- → {!!} Σ-assoc-froⁱ ((a , b) , c) = a , (b , c)

