Let's do an example of a proper 3D cube. Let's say we want to construct this square: q y — — — > z ^ ^ p | | q ^ | | j | x — — — > y ∙ — > p i diamond : (p : x ≡ y) (q : y ≡ z) → Square p q p q To construct this via hcomp, we need to cook up a cube (using a third dimension k) with this square as the top face, and where we know definitions for all the remaining sides. q y — — — — — — — — > z p / ^ q / ^ / | / | / | p / | x — — — — — — — — > y | ^ | ^ | q ^ j | | | | k | / | | | | ∙ — > | | | | i | ? — — — — — | — — > ? | ? / | / | / | / ? | / | / ? — — — — — — — — > ? ? We can make some educated guesses about which Square will work best as the bottom face. The bottom-left corner should be x, because refl is the only immediately available path that ends in x. Similarly, the two bottom-middle corners should be x or y. If we choose x, then two of the resulting faces will involve all of x, y and z, so in the hope of keeping thing simple we go with y. Finally, if the bottom-right corner is z, then the bottom face is exactly the thing we are trying to construct, so to make any progress we must go with y: q y — — — — — — — — > z p / ^ q / ^ / | / | / | p / | x — — — — — — — — > y | ^ | ^ | q ^ j | | | | k | / | | | | ∙ — > | | | | i | y — — — — — | — — > y | p / | / | / | / | / | / x — — — — — — — — > y p Now we have, in fact, seen all of these faces before! (Review the interval algebra in Lecture 2-X if necessary.) diamond-tube : {x y z : A} → (p : x ≡ y) → (q : y ≡ z) → (i j k : I) → Partial (∂ i ∨ ∂ j ∨ ~ k) A
-- Exercise:
-- diamond-tube p q i j k (i = i0) = {!!}
-- diamond-tube p q i j k (i = i1) = {!!}
-- diamond-tube p q i j k (j = i0) = {!!}
-- diamond-tube p q i j k (j = i1) = {!!}
-- diamond-tube p q i j k (k = i0) = {!!} -- Exercise:
-- diamond p q i j = hcomp {!!} {!!} The composition problems that result in some desired square are not unique. Try constructing the same diamond square as above, but using the following alternative cube: q y — — — — — — — — > z p / ^ q / ^ / | / | / | p / | x — — — — — — — — > y | ^ | ^ | q ^ j | | | | k | / | | | | ∙ — > | | | | i
sym p | y — — — — — | — — > y | / | / | / | / | / | / y — — — — — — — — > y diamond-tube-alt : {x y z : A} (p : x ≡ y) (q : y ≡ z) → (i j k : I) → Partial (∂ i ∨ ∂ j ∨ ~ k) A
-- Exercise:
-- diamond-tube-alt p q i j k (i = i0) = {!!}
-- diamond-tube-alt p q i j k (i = i1) = {!!}
-- diamond-tube-alt p q i j k (j = i0) = {!!}
-- diamond-tube-alt p q i j k (j = i1) = {!!}
-- diamond-tube-alt p q i j k (k = i0) = {!!} diamond-alt : (p : x ≡ y) → (q : y ≡ z) → Square p q p q
diamond-alt p q i j = hcomp (∂ i ∨ ∂ j) (diamond-tube-alt p q i j) A crucial application of hcomp for 3-d cubes is showing that the composition square double-comp-box has a filler. That is, not only do we have the double-composition path r ∙∙ p ∙∙ q at the top, but the interior of the square is filled in and we have an element of Square for q y — — — > z ^ ^ p | | r ∙∙ p ∙∙ q ^ | | j | x — — — > w ∙ — > sym r i We orient this square in a diagonally flipped way. You will have to trust us that this is the most convenient orientation to use this square in! Here's the cube we want to fill. q y — — — — — — — — > z / ^ / ^ p / | / r ∙∙ p ∙∙ q / | sym r / | x — — — — — — — — > w | ^ | ^ | ^ j | | | | k | / | | | | ∙ — > | | | | i | y — — — — — | — — > y | p / | / | / | / p | / | / x — — — — — — — — > x We use a new trick to construct this cube. As mentioned above, if a face is missing from the partial element then hcomp fills in the missing face at the top with an hcomp of a lower dimension. In the cube we are trying to construct, the hcomp of the sides for the for the i = i1 face is exactly the double-composite r ∙∙ p ∙∙ q that we wanted as the top edge in the first place. So we don't have to worry about giving a i = i1 case at all. (Which is lucky, because that's exactly the Square we are trying to construct right now!) ∙∙-filler-tube : {w x y z : A} (r : w ≡ x) (p : x ≡ y) (q : y ≡ z) → (i j k : I) → Partial (~ i ∨ ∂ j ∨ ~ k) A
-- Exercise:
-- ∙∙-filler-tube r p q i j k (j = i0) = {!!}
-- ∙∙-filler-tube r p q i j k (j = i1) = {!!}
-- ∙∙-filler-tube r p q i j k (i = i0) = {!!}
-- ∙∙-filler-tube r p q i j k (k = i0) = {!!} ∙∙-filler : (r : w ≡ x) (p : x ≡ y) (q : y ≡ z) → Square p (r ∙∙ p ∙∙ q) (sym r) q
∙∙-filler r p q i j = hcomp (~ i ∨ ∂ j) (∙∙-filler-tube r p q i j) We also have the filler for ordinary composition, just by setting the path r to refl. q y — — — > z ^ ^ ^ p | | p ∙ q j | | | ∙ — > x — — — > x i refl ∙-filler : (p : x ≡ y) (q : y ≡ z) → Square p (p ∙ q) refl q
∙-filler p q = ∙∙-filler refl p q
